Batman The Dark Knight Vol. 01 - Knight Terrors (2012) (digital) (Minutemen-PhD)

Promotional info - &quot;Something sinister is stirring in the veins if Arkham Asylum's inmates. Psychotic and frothing with fiendish strenght, they are unleashed onto the streets of Gotham. The Dark Knight must do everything in his power to protect the people and unmask the culprit behind the mayhem. 

Will Batman survive the onslaught of maniacal attacks - from Scarecrow and Bane to Two-Face and the Court of Owls - long enough to uncover the truth at the end of the rabbit hole? For things are not quite as they seem...

This volume collects Batman: The Dark Knight #1-9&quot;

